class Solution:
    def checkAnagram(self, str1:str, str2:str)->bool:        
        str1 = str1.lower()
        str2 = str2.lower()

        str1 = str1.replace(" ", "")
        str2 = str2.replace(" ", "")

        if len(str1) != len(str2):
            return False

        hashSet = {}
        # The ord() function returns the number representing the unicode code of a specified character.
        for x in str1:
            if ord(x) in hashSet:
                hashSet[ord(x)]+=1
            else:
                hashSet[ord(x)]=1
        for y in str2:
            if ord(y) in hashSet and hashSet[ord(y)]>0:
                hashSet[ord(y)]-=1
            else:
                return False
        return True
    
    def checkAnagramUsingCount(self, str1:str, str2:str)->bool:
        str1 = str1.lower()
        str2 = str2.lower()

        str1 = str1.replace(" ", "")
        str2 = str2.replace(" ", "")

        if len(str1) != len(str2):
            return False
        
        counts = [0]*26

        for x in str1:
            counts[ord(x)-ord('a')] +=1

        for y in str2:
            counts[ord(y)-ord('a')] -=1

        for count in counts:
            if count != 0:
                return False
        return True
            
if __name__ == "__main__":
    solution = Solution()
    print(solution.checkAnagramUsingCount("", ""))

# Time Complexity = O(n+m)
# Space Complexity = O(1) // max size woud be 26